    false,nt"url": null,nt"notes": "In November of 2006, Sanborn was contracted
    by the U.S. Army Corps of Engineers, St. Louis District on behalf of the St. Paul
    District to execute a LIDAR (Light Detection and Ranging) aerial survey, ground
    control survey and mapping for a segment of Rainy River. The project is situated
    on the northern border of Minnesota and consists of an corridor that extends 2000
    feet on both sides of Rainy River (total width of 4000 feet). The corridor extends
    from the International Dam at Fort Frances and International Falls to its mouth
    of Rainy River at Lake-of-the-Woods. Final merged data set created by St. Paul District
    GIS Center.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
